import "./App.css";
import Cities from "./data";

function App() {
  return (
    <div className="App">
      <div className='cities'></div>
      {Cities.map((city, section) => (
        <p key={section}>{city.label}</p>
      ))}
      <hr
        style={{
          color: "#000000",
          backgroundColor: "#000000",
          height: 100,
          borderColor: "#000000",
        }}
      />
    </div>
  );
}

export default App;
